    local acz_wingman_dat_offset = memscan_func(soExactValue, vtByteArray, nil, AczEnvCustom_bytearray_list[5], nil, AczEnvCustom_pcsx2_id_ram_start[2] + 0x700000, AczEnvCustom_pcsx2_id_ram_start[2] + 0x1F00000, "", 2, "0", true, nil, nil, nil)
    local acz_wingman_dat_toc = retrieve_toc(acz_wingman_dat_offset[1])
	
    ---- Wingman aircraft and Special Weapon model LoD: Aircraft model LoD
    AczEnvCustom_data_list[#AczEnvCustom_data_list + 1] = acz_wingman_dat_toc[1] + 0x50
    AczEnvCustom_data_list[#AczEnvCustom_data_list + 1] = (readBytes(acz_wingman_dat_toc[1] + 0x50, 32, true))
	
