        for z = 1, 4 do
		
            writeFloat(acz_wingman_wpn_toc[i] + 0x20 + ((4 * z) - 4), 128000)
			
        end
		
    end
	
	-- Show message asking the user to restart the mission so the effects can take change.
    showMessage("<< Restart the mission to fully apply the changes. >>")
	
