	-- On deactivation, if the script activation was successful then:
	---- Check if the script was deactivated while in a mission. If true then:
		---- Restore modified environment values
	---- else
		---- Restored modified global environment variables
		---- Clear tables
		---- Exit script

if IsAczEnvCustomEnabled then

	if (readBytes(AczEnvCustom_pcsx2_id_ram_start[2] + 0x3FFD1C, 1) ~= 255) then
	
		for i = 1, #AczEnvCustom_data_list,2 do
		
			writeBytes(AczEnvCustom_data_list[i], AczEnvCustom_data_list[i + 1])
			
		end
		
		if readInteger(AczEnvCustom_pcsx2_id_ram_start[2]) ~= nil then
			
			showMessage("<< Restart the mission to fully revert the changes. >>")
		
		end
		
	end
	
	-- Restore default values for the global graphic settings.
	writeBytes(getAddress(AczEnvCustom_pcsx2_id_ram_start[2] + 0x765320), 0x00, 0xFF, 0x7F, 0x47) -- Skybox culling?
