	writeBytes(getAddress(AczEnvCustom_pcsx2_id_ram_start[2] + 0x3F810C), 0x00, 0x00, 0xC0, 0x46) -- Stage geometry LoD value 2.
	
	-- Clean tables containing addresses and bytes
	stage_env_param_list = nil
